$(document).ready(function(){
	$Count = 0
	$('.jumbotron').hide()
	$('.page-footer').hide()
	$(function(){
		interval = setInterval(TriggerOther,300, 600, 900)
		lastinterval = setInterval(TriggerLast, 1500)
	})
	function ShowNow(x){
		$(x).fadeIn('slow')
	}
	$('#1').click(function(){
		$Count+= 1
		if ($Count == 1){
			ShowNow('#2')
		}
		if ($Count == 2){
			ShowNow('#3')
		}
		if ($Count == 3){
			ShowNow('#4')
		}
		if ($Count == 4){
			ShowNow('#5')
		}
	});
	ShowNow('#1')
	function TriggerOther(){
		$('#1').trigger('click')
	}
});